import React from "react";
import "./CatsList.scss";

type Owner = {
  name: string;
};

type Cat = {
  id: string;
  name: string;
  owner: Owner;
};

type Props = {
  cats: [Cat];
};

function CatsList({ cats }: Props) {
  const list = cats.map((c) => (
    <li>
      {c.name} - {c.owner.name}
    </li>
  ));

  return (
    <table>
      <ol>{list}</ol>
    </table>
  );
}

export default CatsList;
